    if (coord.y == 0) {
        let interior = textureLoad(field_in, vec2<i32>(coord.x, 1), 0);
        return vec4<f32>(interior.x, 0.0, 0.0, 0.0); // Preserve tangential (x), zero normal (y)
    }
